import React, { Component } from "react";

export default class datum extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  }
  componentDidMount() {
    fetch("https://gtla6-covidtracker.herokuapp.com/")
      .then((res) => res.json())
      .then((jsonData) => {
        this.setState({
          isLoaded: true,
          data: jsonData,
        });
      });
  }
  render() {
    const { data } = this.state;
    console.log(typeof data);
    return (
      <>
        <div className="container">
        <div className="row justify-content-between">
          <div className="global-data">
            <div>
              Total Cases
              <p>{data.cases}</p>
            </div>
            <div>
            Total Active
              <p>{data.active}</p>
            </div>
            <div>
            Recoveries
              <p>{data.recovered}</p>
            </div>
            <div>
            Deaths
              <p>{data.deaths}</p>
            </div>
          </div>
        </div>
        </div>
      </>
    );
  }
}
